script: |
  super -f text -I q6844.spq | sort > q6844.out

inputs:
  - name: q6844.spq
    data: |
      SELECT DISTINCT col2 / 88 + - col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE - 99 * - - CAST ( - 71 AS INTEGER ) + col1 + + 68 - - col1 BETWEEN NULL AND - col0 OR NOT NULL IS NULL;
  - name: tab0

outputs:
  - name: q6844.out
    data: |
